import Header from './components/Header'
import Image from './components/Image'

function App() {
  return (
    <div>
    <Header className='header'  style={{align:'center'}}/> 


    <p><Image address='https://static6.depositphotos.com/1106232/600/i/600/depositphotos_6003140-stock-photo-skateboard.jpg' 
    alt='Skateboard' className='skateboard'/>
    </p>
    </div>
  )
}

export default App;
